    render() {
        return (
            <div className="card w-75">
                <div className="card-header bg-success text-white">
                    {this.props.username} {this.props.date}
                </div>
                <div classNamee="card-body">
                    {this.props.content}
                </div>
                <div className='card-footer'>
                    <LikeButton />
                    <ReplyButton />
                </div>
            </div>
        );   
    }
}
